import React from "react";
import { Routes, Route, Link } from "react-router-dom";
import "../Calculator.css";

// Import all calculator components
import SIPCalculator from "../components/sip";
// import LumpsumCalculator from "../components/LumpsumCalculator";
// import TopupCalculator from "../components/TopupCalculator";
// import AssetCalculator from "../components/AssetCalculator";
// import OneTimeCalculator from "../components/OneTimeCalculator";
// import RegularCalculator from "../components/RegularCalculator";

// Define calculators list with image, link & component
const calculators = [
  { img: "/calculator/sip.png", link: "../components/sip", label: "SIP Calculator", component: <SIPCalculator /> },
  // { img: "/calculator/lumpsum.png", link: "/lumpsum", label: "Lumpsum Calculator", component: <LumpsumCalculator /> },
  // { img: "/calculator/topup.png", link: "/topup", label: "Top-up Calculator", component: <TopupCalculator /> },
  // { img: "/calculator/asset.png", link: "/asset", label: "Asset Calculator", component: <AssetCalculator /> },
  // { img: "/calculator/onetime.png", link: "/onetime", label: "One-Time Investment", component: <OneTimeCalculator /> },
  // { img: "/calculator/regular.png", link: "/regular", label: "Regular Investment", component: <RegularCalculator /> }
];

function Calculator() {
  return (
    <div>
      <h2>Choose a Calculator</h2>
      <div className="container">
        {calculators.map((calc, index) => (
          <div className="image-grid" key={index}>
            <img src={calc.img} alt={calc.label} />
            <div className="middle">
              <Link to={calc.link}>
                <button>{calc.label}</button>
              </Link>
            </div>
          </div>
        ))}
      </div>

      {/* Routes for Each Calculator */}
      <Routes>
        {calculators.map((calc, index) => (
          <Route key={index} path={calc.link} element={calc.component} />
        ))}
      </Routes>
    </div>
  );
}

export default Calculator;
